import React from "react";
import Card from "./card.jsx";

const ListCards = ({ robots }) => {
  const robotsComponent = robots.map((robot, i) => {
    return (
      <Card
        key={i}
        id={robot[i].id}
        name={robot[i].name}
        email={robot[i].email}
      />
    );
  });

  return <h1>hello world</h1>;
};

export default ListCards;
